import React, {Component} from 'react';
import {Link} from 'react-router-dom';
import PostThread from './post_thread.component';

export default class Catalog extends Component{
    constructor(props){
        super(props);

        this.state = {
            threads: []
        };
    }

    componentDidMount(){
        //get threads
    }

    render(){
        return(
            <div>
                Catalog
                <PostThread props={this.state.threads} />
            </div>
        );
    }
}
